import React from "react";
import DegreeTabs from "../components/DegreeTabs"
import Page from "../layouts/Page";


function Academics(){
  const links = [
    {
      to: 'degreeSection',
      text: 'Degrees'
    },
    {
      to:"minorsSection",
      text:"Minors"
    },
    {
      to:"corusesSection",
      text:"Courses"
    }
  ];

  return (
    <Page title="Academics" links={links} children={<DegreeTabs/>}></Page>

);

};

export default Academics;
